import React from "react";

import { Button, Stack, TextField, Typography } from "@mui/material";

import "./login.css";

export default function Login() {
  return (
    <div>
      <form className="login_form">
        <Typography
          variant="h2"
          textAlign={"center"}
          sx={{
            marginBottom: "1em",
            color: "#ffffff",
          }}
        >
          LOGIN
        </Typography>
        <Stack alignItems={"center"} spacing={6}>
          <div>
            <TextField
              required
              id="filled-required"
              label="Email"
              placeholder="Email"
              variant="filled"
              sx={{
                background: "#ffffff",
                borderRadius: "10rem",
                width:"15em"
              }}
            />
          </div>
          <div>
            <TextField
              id="filled-password-input"
              label="Password"
              type="password"
              autoComplete="current-password"
              variant="filled"
              sx={{
                background: "#ffffff",
                borderRadius: "10rem",
              }}
            />
          </div>
          <div className="form_button">
            <Button type="submit">Submit</Button>
          </div>
          <div>
            <Typography variant="body1" sx={{ color: "#ffffff" }}>
              Don't have an account? <span style={{color:"#308335"}}> Signup </span>
            </Typography>
          </div>
        </Stack>
      </form>
    </div>
  );
}
